import React from 'react'
import icon from '../img/iconprofile.svg';

function Icon() {
	return (
		
		<div className='profile' onMouseEnter={this.handleProfileMouseEnter} onMouseleave={this.handleProfileMouseLeave}>
			<a href='#'>
			</a>
		</div>
	)
}

export default Icon
